import React from "react";
import ImaMealsImage from '../../../public/meals.jpg'
const Header = () => {
    return (
        <React.Fragment>
            <header>
                <h1>ImaMeals</h1>
                <button>Cart</button>
            </header>
            <div>
                <img src={process.env.PUBLIC_URL + ImaMealsImage} />
            </div>
        </React.Fragment>
    )
}

export default Header;
